import { Flex, Layout, Slider } from 'antd';
const { Header, Footer, Sider, Content } = Layout;

function Filter() {
	return (
		<div className="FilterArea">
			<div className="LocationArea">
                <Flex gap="middle" wrap>
                    <Layout>
                        <Sider width="10%">
                            <b><p>位置</p></b>
                        </Sider>
                        <Sider>
                            <checkbox>123</checkbox>
                        </Sider>
                    </Layout>
                </Flex>
			    
                
			</div>
		</div>
	);
}

export default Filter;
